import "./mailList.css"

const MailList = () => {
    return(
        <div className="mail">
            <h1 className="mailTitle">Save time save planet!</h1>
            <span className="mailDesc">Sing in before sun runs out of time!</span>
            <div className="mailInputContainer">
                <input type="text" placeholder="Your email"/>
                <button className="button">Subscribe</button>
            </div>
        </div>
    )
}

export default MailList;
